import React, { useEffect,} from "react";
import { connect } from "react-redux";

import {fetchMalls,} from "../../Store/actions"

const Mallsdata = ({fetchMalls,}) => {

  useEffect(() => {fetchMalls()}, [fetchMalls,]);

  return (
    <div className="border-right border-dark fl menu-w">
      {fetchMalls}        
    </div>
  );
};

const mapDispatchToProps = {fetchMalls,};

export default connect(mapDispatchToProps)(Mallsdata);
